import React from 'react'
import { useNavigate } from 'react-router-dom'
function Dasboard() {
  const navigate=useNavigate();
  const dologout = ()=>{
    navigate("/");
  }
  return (
    <div>
      <button onClick={dologout}>logout</button>
    </div>
  )
}

export default Dasboard
